    // Function to create the folder structure
    function createFolder(folderName, content) {
        const folder = document.createElement("div");
        folder.classList.add("folder");

        const folderFrame = document.createElement("div");
        folderFrame.classList.add("folder-frame");
        folderFrame.textContent = folderName;

        const folderContent = document.createElement("div");
        folderContent.classList.add("folder-content");

        folderFrame.addEventListener("click", () => {
            const isOpen = folderFrame.classList.toggle("open");
            folderContent.style.display = isOpen ? "block" : "none";
            collapseOtherFolders(folder);
        });

        folder.appendChild(folderFrame);
        folder.appendChild(folderContent);

        content.forEach(item => {
            if (item.type === "folder") {
                const childFolder = createFolder(item.name, item.content);
                folderContent.appendChild(childFolder);
            } else if (item.type === "file") {
                const fileFrame = document.createElement("div");
                fileFrame.classList.add("file-frame");

                const fileName = document.createElement("span");
                fileName.textContent = item.name;

                const fileSize = document.createElement("span");
                fileSize.classList.add("file-size");
                fileSize.textContent = `(${item.size})`;

                const fileActions = document.createElement("div");

                const viewLink = document.createElement("a");
                viewLink.href = item.path;
                viewLink.innerHTML = 'View <i class="fas fa-eye"></i>';
                viewLink.target = "_blank";

                const downloadLink = document.createElement("a");
                downloadLink.href = item.path;
                downloadLink.innerHTML = 'Download <i class="fas fa-arrow-down"></i>';

                fileActions.appendChild(viewLink);
                fileActions.appendChild(downloadLink);
                fileFrame.appendChild(fileName);
                fileFrame.appendChild(fileSize);
                fileFrame.appendChild(fileActions);

                folderContent.appendChild(fileFrame);
            }
        });

        return folder;
    }

    // Render the folder structure
    folderStructure.forEach(item => {
        if (item.type === "folder") {
            const folder = createFolder(item.name, item.content);
            fileExplorer.appendChild(folder);
        } else if (item.type === "file") {
            const fileFrame = document.createElement("div");
            fileFrame.classList.add("file-frame");

            const fileName = document.createElement("span");
            fileName.textContent = item.name;

            const fileSize = document.createElement("span");
            fileSize.classList.add("file-size");
            fileSize.textContent = `(${item.size})`;

            const fileActions = document.createElement("div");

            const viewLink = document.createElement("a");
            viewLink.href = item.path;
            viewLink.innerHTML = 'View <i class="fas fa-eye"></i>';
            viewLink.target = "_blank";

            const downloadLink = document.createElement("a");
            downloadLink.href = item.path;
            downloadLink.innerHTML = 'Download <i class="fas fa-arrow-down"></i>';

            fileActions.appendChild(viewLink);
            fileActions.appendChild(downloadLink);
            fileFrame.appendChild(fileName);
            fileFrame.appendChild(fileSize);
            fileFrame.appendChild(fileActions);

            fileExplorer.appendChild(fileFrame);
        }
    });

    // Function to collapse all other folders when one is clicked
    function collapseOtherFolders(currentFolder) {
        const siblingFolders = currentFolder.parentElement.children;
        Array.from(siblingFolders).forEach(folder => {
            const folderFrame = folder.querySelector(".folder-frame");
            const folderContent = folder.querySelector(".folder-content");
            if (folder !== currentFolder) {
                folderFrame.classList.remove("open");
                folderContent.style.display = "none";
            }
        });
    }
    
